import React from 'react'
import LoginForm from './LoginForm'
import { Link } from "react-router-dom"

const LandingPage = () => {
    const handleClick = () => {
      navigate('/login')
    }
  return (
    <div>
      <h2>Landing Page</h2>
      <button onClick={() => {handleClick}}>Login</button>
    </div>
  )
}

export default LandingPage
